      <nav className="flex gap-3">
        <button className="glass-btn">Points</button>
        <button className="glass-btn">Clock</button>
        <button className="glass-btn">Confetti</button>
        <button className="glass-btn">Leaderboard</button>
      </nav>
    </header>
  );
};

